public boolean equals(Object obj) {
  if (obj == null) {
    return false;
  }
  if (obj == this) {
    return true;
  }
  if (obj.getClass() != getClass()) {
    return false;
  }
  DelayWrapper dw = (DelayWrapper) obj;
  return new EqualsBuilder()
      .appendSuper(super.equals(obj))
      .append(time, dw.time)
      .append(job, dw.job)
      .build();
}
